import React from 'react';
import heroImage from '../../assets/hero-image.png';

const Home = () => {
  return (
    <div
      className="pt-10"
      style={{
        backgroundColor: '#C4B682'
      }}>
      <div className="mx-auto px-6 md:px-20 xxl:px-0" style={{ maxWidth: '1550px' }}>
        <div className="flex justify-around w-full">
          {/* <div className="w-1/2 flex"> */}
          <img src={heroImage} alt="" className="-mt-8 h-auto" style={{ maxWidth: '20%' }} />
          {/* </div> */}
          <div className="w-1/2 flex">
            <div className="flex-grow">
              <div className="grid place-items-center">
                <div>
                  <h1 className="font-semibold text-5xl leading-tight max-w-96 mb-5">
                    Where Beauty Meets Luxury -<br />
                    <span className="text-white">Sugar&apos;d Bare</span>
                  </h1>
                  <p className="max-w-40">
                    Indulge in expert sugaring and top-tier beauty services, all delivered with a
                    warm and welcoming touch.
                  </p>
                  <div className="flex justify-center">
                    <a href="#" className="flex">
                      <p className="text-xs underline font-semibold text-center pt-12">
                        View Services
                      </p>
                      {/* add animation to make button bounce */}
                      <button>arrow</button>
                    </a>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;

